var g=g||{};(function(){"use strict";var FORM,CREF=0,NAME="apply",DESC="apply to the hackathon event";function man(std){std.io.writeLine(NAME);std.io.writeLine("  "+DESC)}function getLang(std,input){FORM.lang=input;std.io.lock();std.io.writeLine("Sending request...");g.register.register(FORM,function(response){std.io.writeLine("Data received, processing...");std.io.newLine();if(!response.response){var keys=Object.keys(response.message);std.io.writeLine("Oups, error(s) occured in "+keys.join(", ")+":");for(var i=0;i<keys.length;i++)std.io.writeLine(keys[i]+": "+response.message[keys[i]])}else std.io.writeLine("Thank you, we have received your "+"application! If you are a developer, "+"don't forget to type in: 'doc'");std.io.release()})}function getMail(std,input){FORM.mail=input;std.io.write("Programming languages you are good at (optional): ");std.io.setReader(getLang);return true}function getName(std,input){FORM.name=input;std.io.write("Your mail: ");std.io.setReader(getMail);return true}function getRole(std,input){FORM.role=input;switch(input){case"e":case"E":case"entrepreneur":case"Entrepreneur":case"ENTREPRENEUR":FORM.role="entrepreneur";break;default:FORM.role="programmer"}std.io.write("Your name: ");std.io.setReader(getName);return true}function main(std,argv){FORM={};std.io.writeLine("Please fill the following form "+"to apply to the kibu hackathon event!");std.io.write("Are you a programmer or entrepreneur? [P/e] ");std.io.setReader(getRole)}g.install(NAME,{main:main,man:man,desc:DESC},["join","register"])})();